import React, {useState, useEffect} from 'react'
import './App.css'
import * as ds from "./DataService"
import * as rr from './ReactiveRobot'
import * as ev from './Events'
import Component1 from "./Component1"

function App() {
  const [chartValues, updateChartValues] = useState([])
  console.log('App==>this:', this)

  useEffect(()=>{
    console.log('useEffect==>this:', this)
    rr.addObserver(onEvent)
    ds.getData()
  },[])

  function onEvent(event){
    switch (event.type){
      case ev.TEST_APP:
        console.log('App==>got TEST_APP event')
    }
  }

  return (
    <div className="App">
      App
      <Component1/>
    </div>
  );
}

export default App;
